    false,nt"url": null,nt"notes": "A Limited Denial of Participation (LDP)
    is an action taken by a HUD Field Office or the Deputy Assistant Secretary for Single
    Family (DASSF) or Multifamily (DASMF) Housing which excludes a party from further
    participation in a HUD program area. The scope of the LDP is limited to the geographic
    area of the office which sent the notice to the party. DASSF & DASMF LDPs are effective
    nationwide unless otherwise noted. An LDP generally expires in one year. A HUD",nt"license_title":
